import React from 'react';
import classes from './Project.module.css';

const user = (props) => (
  <figure>
    <a href={props.url}>
      <img
        className={classes.Img}
        src='../assets/burger.jpg'
        alt='burger image'
      />
    </a>
    <figcaption>{props.description}</figcaption>
  </figure>
);

export default user;
